const styleLogo = {
    fontSize: 40,
    fontWeight: 'bold',
    color: 'blue'
}

const Logo = () => {
    return (
        <div>
            <h1 style={styleLogo}>Fale Mais</h1>
        </div>
    );
}

export default Logo;
